// Sending Facility - Change MSH 4.1 to KEMH
var sendingFacility = msg['MSH']['MSH.4']['MSH.4.1'].toString();
sendingFacility = "KEMH";
tmp['MSH']['MSH.4']['MSH.4.1'] = sendingFacility;
channelMap.put("sendingFacility", sendingFacility);

// MSH-5, Receiving Application, Set to value RAD
tmp['MSH']['MSH.5']['MSH.5.1'] = "RAD";

var eventType = msg['MSH']['MSH.9']['MSH.9.2'].toString();
tmp['MSH']['MSH.9']['MSH.9.2'] = eventType;
channelMap.put('msgEventType', eventType);

// Date/Time of Message - Set date/time to original
var mshDate = msg['MSH']['MSH.10']['MSH.10.1'].toString();
channelMap.put("MSHDATE", mshDate);
tmp['MSH']['MSH.7']['MSH.7.1'] = msg['MSH']['MSH.10']['MSH.10.1'].toString();

//// Message Control ID - Set Message Control ID to original
tmp['MSH']['MSH.10']['MSH.10.1'] = mshDate;
//
//// Processing ID - Set Processing ID to original
tmp['MSH']['MSH.11']['MSH.11.1'] = "P";
//
//// Version ID - Set Version ID to original
tmp['MSH']['MSH.12']['MSH.12.1'] = "2.3";

//=====PID (Patient Identification)=====
// PID - set to original
tmp['PID'] = msg['PID'];

// Capture first 18 fields of PID segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 18; i++) {
	tmpSegment += tmp['PID']['PID.' + i];

}
tmp['PID'].setChildren(tmpSegment);

// Patient ID PID 2.1 - Blank out PID 2.1
tmp['PID']['PID.2']['PID.2.1'] = "";

// Patient ID PID 3.1 - Remove dash and leading 0
var patientID = msg['PID']['PID.3']['PID.3.1'].toString().replace(/-/g, "");
tmp['PID']['PID.3']['PID.3.1'] = patientID.replace(/^0+/, "");

// PID-7, Date of Birth, transform to 8 digits
var dob = msg['PID']['PID.7']['PID.7.1'].toString();
tmp['PID']['PID.7']['PID.7.1'] = dob.slice(0, 8);

// PID-18, Patient Account Number, Set to ID in PV1-19
tmp['PID']['PID.18']['PID.18.1'] = msg['PV1']['PV1.19']['PV1.19.1'].toString();

tmp['PV1'] = msg['PV1'];

// Capture first 3 fields of PV1 segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 2; i++) {
	tmpSegment += tmp['PV1']['PV1.' + i];

}
tmp['PV1'].setChildren(tmpSegment);

// OBR - set to original
tmp['OBR'] = msg['OBR'];

// Capture first 25 fields of OBR segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 25; i++) {
	tmpSegment += tmp['OBR']['OBR.' + i];

}
tmp['OBR'].setChildren(tmpSegment);

var orderNumber = msg['ORC']['ORC.2']['ORC.2.1'].toString();
// OBR-2, Place Order Number, Set to ORC-2
tmp['OBR']['OBR.2']['OBR.2.1'] = orderNumber;
// OBR-3, Filler Order Number, Set to ORC-2
tmp['OBR']['OBR.3']['OBR.3.1'] = orderNumber;

// OBR-7, Quantity/Timing, Set to MSH-7 Date value 
tmp['OBR']['OBR.7']['OBR.7.1'] = $('MSHDATE');

// Set OBR-8, Observation End Time, to empty
tmp['OBR']['OBR.8']['OBR.8.1'] = "";

// OBR-20, Filler Field, Set to original OBR-2
tmp['OBR']['OBR.20']['OBR.20.1'] = msg['OBR']['OBR.2']['OBR.2.1'].toString();

// OBR-22, Result Status, Set to message MSH-7 Date
tmp['OBR']['OBR.22']['OBR.22.1'] = $('MSHDATE');

// Set OBR-24, Diagnostic Service ID, to value "RAD"
tmp['OBR']['OBR.24']['OBR.24.1'] = "RAD";

// OBR-25, Result Status, Transform from Sent to P value
tmp['OBR']['OBR.25']['OBR.25.1'] = "P";

//=====OBX (Observation Result)=====
tmp['OBX'] = msg['OBX'];

// Capture first 14 fields of OBX segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 14; i++) {
	tmpSegment += tmp['OBX']['OBX.' + i];

}
tmp['OBX'].setChildren(tmpSegment);

// OBX-2, Value Type, Set to RP value
