// OBX-11, Observation Result Status, Set to P value
tmp['OBX']['OBX.11']['OBX.11.1'] = "P";

// OBX-14, Date of the Observation, set to MSH-7 Date
tmp['OBX']['OBX.14']['OBX.14.1'] = $('MSHDATE');

