//Gitlab version 9
// Save the original HL7 message
channelMap.put("originalHL7Msg", connectorMessage.getRawData());

// Set MSH to original
tmp['MSH'] = msg['MSH'];

// Set Sending Facility (MSH-4.1) 
var facilityName = tmp['MSH']['MSH.4']['MSH.4.1']
channelMap.put("facilityName", facilityName);

// Set Receiving Application (MSH-5.1) 
var appName = tmp['MSH']['MSH.5']['MSH.5.1'];
channelMap.put("appName", appName);

// Map MSH-9.2, Event
var eventType = msg['MSH']['MSH.9']['MSH.9.2'].toString();
channelMap.put('msgEventType', eventType);

// Capture first 12 fields of MSH segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 12; i++) {
    tmpSegment += tmp['MSH']['MSH.' + i];
}
tmp['MSH'].setChildren(tmpSegment);

// Set PID to original
// (Optionally, include encoded data if needed)
tmp['PID'] = msg['PID'];


// Capture first 18 fields of PID segment
var tmpSegment = new XMLList();
for (var i = 1; i <= 18; i++) {
    tmpSegment += tmp['PID']['PID.' + i];
}
tmp['PID'].setChildren(tmpSegment);

